import React,{useState,useEffect} from "react";
import classes from "./LeftUserBoxContainer.module.css"
import LeftUserBox from "./LeftUserBox";

import classimg from '../../../../images/groupImage.png';
import axiosInstance from '../../../../axios';




import PostData from './posts.json';





const LeftUserBoxContainer = () =>{


const [data, setData ] = useState([
    {
        "id": 6,
        "title": "GGGGG",
        "author": 1,
        "category": 1,
        "excerpt": "cdcd",
        "content": "adadfvdfv dc sd asdkad clkASD, ASDAS",
        "status": "open",
        "pstatus": "draft",
        "priority": "high",
        "resolution": "unresolved",
        "created_at": "2021-12-22T11:48:10.381307Z"
    }]);



useEffect(() =>{

      axiosInstance.get(`tickets/`).then((res) => {
                        setData(res.data);
                        console.log('data inside tickets',res.data);
                });



  },[]);










let groupname="Classical Mechanics-I";

return(

<div className={classes.leftUserBoxContainer}>

<LeftUserBox userImage={classimg} userName={groupname} />


	{data.map((postDetail,index)=>{

           return <LeftUserBox key={index} userName={"CLM - "+postDetail.id} data={postDetail.status} datatest={postDetail} />

	}


	)}


</div>

);

}

export default LeftUserBoxContainer;
